sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'zone', 'instance', 'fingerprint']);
    gcc.maptoOutputFromInput(inputs, outputs, ['projectid', 'zone', 'instance']);
    var requestBody = {
        'fingerprint': inputs.fingerprint
    };
    if (inputs.tags.length > 0) {
        var tags = [];
        inputs.tags.forEach(function(tag) {
            if (tag.trim())
                tags.push(tag);
        });
        if (tags.length < 1)
            throw new Error("Tags are not entered");
        requestBody.tags = {
            "items": tags
        };
    }
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

